Step 1: Key Psychological Mechanisms 
• Participants judge fairness by comparing their own token search (token_self) and their opponent’s token search (token_opp). 
• A core fairness norm is that, when contributions are equal, a 50% allocation is expected; when contributions differ, the fair share is determined by the ratio token_opp/(token_self + token_opp). 
• Participants may deviate from a “fair” division by modulating the influence of fairness with a weighting parameter (omega). In addition, they might nonlinearly transform the perceived fairness using a sensitivity parameter (k).

Step 2: Interactions 
• The fairness evaluation (fair_share) is computed as the token-opponent fraction (after applying a power transformation k) of the total tokens. 
• A convex combination is then taken between the normative baseline (50%) and the fairness-derived share to yield the final proposed percentage allocation. The weighting (omega) controls how much fairness influences the decision relative to the baseline.

Step 3: Mathematical Form 
• Compute the fairness share as: fair_share = 100 · (token_opp^k)/(token_opp^k + token_self^k)  
• Then the predicted proposed percentage is: proposed_perc = 50 + omega · (fair_share − 50)

Step 4: Learnable Parameters 
• Omega (ω): weighs the deviation from the fairness-neutral baseline.  
• k: modulates the sensitivity to the relative token contributions.

Step 5: Mapping to Observable Behavior 
• The input variables token_opp and token_self are observed from data.  
• The model predicts the participant’s proposed percentage (proposed_perc) directly via the fairness-based computation.

The formal model and variable descriptions are given below.

<MODEL>
proposed_perc = 50 + omega * (100 * (token_opp^k / (token_opp^k + token_self^k)) - 50)
</MODEL>

